import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" aria-hidden="true" style={{
    msTransform: "rotate(360deg)",
    WebkitTransform: "rotate(360deg)"
  }} viewBox="0 0 2048 2048" transform="rotate(360)" {...props}><rect width={17.563} height={14.478} x={1.23} y={1035.052} rx={2.759} fill="none" stroke="#82CAED" strokeWidth={1.034} strokeLinecap="round" strokeLinejoin="round" transform="translate(55.328 -99820.702) scale(96.7529)" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" aria-hidden="true" focusable="false" width="1em" height="1em"  style="-ms-transform: rotate(360deg); -webkit-transform: rotate(360deg); transform: rotate(360deg);" preserveAspectRatio="xMidYMid meet"  viewBox="0 0 2048 2048">  <rect width="17.563" height="14.478" x="1.23" y="1035.052" rx="2.759" fill="none" stroke="rgb(130,202,237)" stroke-width="1.034" stroke-linecap="round"  stroke-linejoin="round" transform="matrix(96.7529 0 0 96.7529 55.328 -99820.702)"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
